INSERT INTO `wp_posts` VALUES (244,1,'2020-03-21 16:31:40','2020-03-21 15:31:40','<ol>\r\n	<li>Ime i prezime * [text* your-name id:contact-full-name class:form-control class:form-control-sm akismet:author]</li>\r\n	<li>E-mail * [email* your-email id:contact-email class:form-control class:form-control-sm]</li>\r\n	<li>Telefon [tel your-telephone id:contact-telephone class:form-control class:form-control-sm]</li>\r\n	<li>Naslov * [text* your-subject id:contact-subject class:form-control class:form-control-sm]</li>\r\n	<li>Poruka * [textarea* your-message id:contact-message class:form-control class:form-control-sm]</li>\r\n</ol>\r\n<p>\r\n	* Obavezna polja\r\n</p>\r\n[submit id:contact-send class:btn class:btn-primary class:btn-wide \"Pošalji\"]\n1\nExclusive \"[your-subject]\"\nExclusive <info@exclusive.local>\ndenishmorinski@gmail.com\nPošiljatelj: [your-name] <[your-email]>\r\nNaslov: [your-subject]\r\n\r\nTelefon: [your-telephone]\r\n\r\nPoruka:\r\n[your-message]\r\n\r\n-- \r\nOvaj E-mail je poslan putem kontakt forme s Exclusive web stranice (http://exclusive.local)\n\n\n\n\n\nExclusive \"[your-subject]\"\nExclusive <wordpress@exclusive.local>\n[your-email]\nMessage Body:\r\n[your-message]\r\n\r\n-- \r\nThis e-mail was sent from a contact form on Exclusive (http://exclusive.local)\nReply-To: denishmorinski@gmail.com\n\n\n\nVaša poruka je uspješno poslana.\nDošlo je do pogreške prilikom slanja poruke. Molim pokušajte kasnije.\nJedno ili više polja imaju grešku. Provjerite i pokušajte ponovno.\nDošlo je do pogreške prilikom slanja poruke. Molim pokušajte kasnije.\nMorate prihvatiti uvjete prije slanja poruke.\nPolje je obavezno.\nSadržaj polja je predug.\nSadržaj polja je prekratak.\nFormat datuma je netočan.\nDatum je manji od minimalno dozvoljenog.\nDatum je veći od maksimalno dozvoljenog.\nDošlo je do pogreške prilikom učitavanja datoteke.\nVrsta učitane datoteke nije dozvoljena.\nDatoteka je prevelika.\nDošlo je do pogreške prilikom učitavanja datoteke.\nBrojčani format je netočan.\nBroj je manji od minimalno dozvoljenog.\nBroj je veći od maksimalno dozvoljenog.\nRezultat upitnika je negativan.\nUneseni E-mail nije ispravan.\nURL nije ispravan.\nBroj telefona nije ispravan.','Kontakt forma','','publish','closed','closed','','contact-form-1','','','2020-03-22 10:17:19','2020-03-22 09:17:19','',0,'http://exclusive.local/?post_type=wpcf7_contact_form&#038;p=244',0,'wpcf7_contact_form','',0);
